import {Component} from 'react';
import{Link} from 'react-router-dom';
import {parseJwt} from '../../services/auth';

import Header from '../../Components/header/header'
import '../../App.css';

class Admin extends Component{
    constructor(props){
        super(props);
        this.state = {
            listaConsultas : [],
            medicoNome : '',
            pacienteNome : '',
            horarioConsulta : '',
            statusConsulta : '',
            descricaoDaConsulta : ''
        }
    }



    render(){
        return(
            <div>
                <Header />
                <Link to="/"><h3 className="logout">Sair</h3></Link>
                <section className="section-cadastrar-consulta">
                    <h1>Cadastrar consultas</h1>
                    <div className="cadastrar-consulta">
                        <form className="cadastrarConsulta">
                            <h2>Nome do médico</h2>
                            <input type="text" placeholder="Nome do médico" />>
                        </form>
                    </div>
                </section>
            </div>
        )
    }
}

export default Admin;
